class Solution {
  int continuousSubarrays(List<int> nums) {
    int count = 0;
    int left = 0; // Start of the window
    for (int right = 0; right < nums.length; right++) {
      // Move right edge of the window to the right
      for (int i = left; i <= right; i++) {
        // Check if the current window is valid
        if ((nums[right] - nums[i]).abs() > 2) {
          // If not valid, move the left edge of the window
          left = i + 1;
        }
      }
      // Count the number of subarrays ending at `right`
      count += right - left + 1;
    }
    return count;
  }
}
